        'Bez masa',
        'SUROVINY
        500g špaldové celozrnné mouky
        380ml teplé vody
        1 balíček sušeného droždí
        1 lžíce oleje
        1 lžička cukru
        1/2 lžíce chia (chléb bude vláčnější)
        1 a 1/4 lžičky soli
        PŘÍPRAVA
        Z teplé (ne vařící) vody, sušeného droždí a cukru udělejte kvásek. Smíchejte tyto suroviny a nechte 10 minut stát.
        Mezitím ve velké míse promíchejte špaldovou mouku, cukr, chia semínka a sůl
        Když je kvásek hotový můžete ho nalít do mísy s moukou a přidat i olej.
        Ručně nebo v kuchyňském robotu vypracujte těsto. Trvá to asi 5 minut než bude dobře propracované.
        Těsto nechte 45 minut kynout pod utěrkou.
        Těsto přeneste do formy (vymazaná a moukou vysypané) nebo položte na plech vyložený pečícím papírem a vytvarujte bochník Nechte kynout dalších 30 minut.
        Pečte v předehřáté troubě na 180 stupňů po dobu 25-30 minut. K pečení používám spodní část trouby. Když jsem chleba dávala výše vršek byl připálený.
        TIP: chleba můžete před pečením potřít vodou a posypat semínky. ',
